(function(){
	
	extractPage = function( param ) {
		var t = this;
		t.config = $.extend(true , {
			elem: "body" , 
			BWidth: 460,
			BHeight: 350,
			backBg : "#eef2f6" ,
			BHeadBg: "#438aee",
			bBodyBg: "#fff",
			submitBg: "#3b8cff" , 
			submitFunc : function(){}
		} , param)
		
		var getStyle = function() {
			var bw = t.config.BWidth , bh = t.config.BHeight;
			return "" +
					".extract_back{ z-index: 99999999;width: 100% ; height: 100%;background-color:"+t.config.backBg+";position: absolute;top: 0px;left: 0px;}" +
					".extract_box{ width: "+bw+"px ; height:  "+bh+"px;position: absolute; top: 50%;left: 50%; margin-left: -"+(bw/2)+"px;margin-top: -"+(bh/2+50+15)+"px;  }" +
					".extract_LOGO{ width: "+bw+"px ; height:  100px; background: url() no-repeat center top;}" +
					".extract_Head{ width: "+bw+"px ; height:  82px;background-color:"+t.config.BHeadBg+";color: #fff;border-top-left-radius: 4px;border-top-right-radius: 4px; }" +
					".extract_boxHeadImage{width:87px;height: 82px;position: relative;}" +
					".extract_boxHeadImageBox{ padding: 4px;background: #3779d6;   width: 52px;height: 52px;overflow: hidden;border-radius: 60px;position: absolute;left: 25px;top: 15px;}" +
					".extract_bhibImage{background-repeat: no-repeat;background-size: 100% 100%;width: 44px;height: 44px;border-radius: 50%;width: 100%;vertical-align: middle;background-image:url('data:image/jpeg;base64,');}" +
					".extract_Body{ width: "+bw+"px ; height:  168px;background-color:"+t.config.bBodyBg+";border-bottom-left-radius: 4px;border-bottom-right-radius: 4px; }" +
					".extract_bbBox{ padding: 20px 30px 30px;float: left;width: 100%;height: 100%;}" +
					".extract_divTitle{padding: 0 0 5px;margin: 20px 0 10px;color: #5b667b;text-align: left;font-size: 14px;    font-family: 'Microsoft YaHei', arial, SimSun, 宋体;}" +
					".extract_output{width: 100%;height: 36px;}" +
					".extract_output>*{float:left;}.extract_errorTitle{color: #ff5858;font-size: 12px;margin-top: 10px;}" +
					".extract_outputInput{width: 300px;outline:none;color: #666666;border: 1px solid #f2f2f2;padding: 8px 10px;height: 36px;line-height: 36px;background: #f2f2f2; border-radius: 4px;}" +
					".extract_submit{width: 80px;height: 36px;border-radius: 4px;margin-left: 14px;line-height: 36px;background: "+t.config.submitBg+";color: white;font-size: 13px;text-align: center;cursor: pointer}" +
					".extract_yunduo{position: absolute;width: 100%;height: 301px;background-repeat: repeat-x;background-position: 0 bottom;bottom: 0;background: url(data:image/png;base64,);}";
	}
		
		
		if($("style[extract-style]").length<=0){$("head").append("<style extract-style=true>"+getStyle()+"</style>");}
		
		var $_back = $("<div class='extract_back'>");
		var $_yunduo = $("<div class='extract_yunduo'>");
		var $_box = $("<div class='extract_box'>");
		var $_boxLOGO = $("<div class='extract_LOGO'>");
		var $_boxHead = $("<div class='extract_Head'>");
		var $_boxHeadImage = $("<div class='extract_boxHeadImage'>");
		var $_boxHeadImageBox = $("<div class='extract_boxHeadImageBox'>");
		var $_bhibImage = $("<div class='extract_bhibImage'>")
		var $_boxHeadSpan = $("<span>");
		$_boxHead.append($_boxHeadImage.append($_boxHeadImageBox.append($_bhibImage)));
		
		var $_boxBody = $("<div class='extract_Body'>");
		var $_bbBox =$("<div class='extract_bbBox'>");
		var $_divTitle = $("<div class='extract_divTitle'>").text("请输入提取码 :");
		var $_output = $("<div class='extract_output'>");
		var $_outputInput = $("<input id='extract_outputInput' type='text' class='extract_outputInput'>")
		var $_submit = $("<div id='extract_submit' class='extract_submit'>").text("提取");
		var $_errorTitle = $("<div id='extract_errorTitle'  class='extract_errorTitle'>");
		$_boxBody.append($_bbBox.append($_divTitle).append($_output.append($_outputInput).append($_submit)).append($_errorTitle));
		
		$_back.append( $_box.append($_boxLOGO).append($_boxHead).append($_boxBody) ).append($_yunduo);
		$(t.config.elem).append($_back);
		
	}
	
	extractPage.prototype = {
			close : function() {
				$(".extract_back").remove();
			} , 
			func : function() {
				var t = this;
				t.errorObj = $("#extract_errorTitle");
				t.submitObj = $("#extract_submit");
				$(t.submitObj).click(function(){
					var val = $("#extract_outputInput").val();
					if( null != val && undefined != val && val.length !== 0 ){
						t.config.submitFunc(val , t);
					}else{
						$(t.errorObj).text("请输入提取码再提交");
					}
				});
			}
	}
	
})(jQuery);


